import React, {useContext} from 'react';
import styled from "styled-components";
import { GlobalContext } from '../context/GlobalState';

const CSS = styled.div`
  width: fit;
  background: transparent;

  .search-item{
    width:100%;
    text-align: left;


      border: 1px solid #3D484C;
      background: #2D3538;
      padding: 8px;
      border-radius: 0px;
      font-size: 5%;
      padding-right: 30px;
      color: #DDD;  


      background: #2D3538 url(http://picbox.im/image/cba14e57f0-validicon.png) no-repeat 99% 50%;
      background-position: right 6px center;

  }
`;

//graphSymbol(mySymbol.symbol, 'day', true)
export const SearchItem = ({ mySymbol }) => {
  const { graphSymbol } = useContext(GlobalContext);

  return (
    <div>
      <CSS>
        <button className="search-item" onClick={() => graphSymbol(mySymbol.symbol, 'day', true)}>
          <p><span className="">({mySymbol.symbol}) </span>{mySymbol.name}</p>
        </button>
      </CSS>
    </div>
  )
}
